import React from 'react';

const GuestPage = () => (
  <div>
    <h2>Welcome Guest</h2>
    <p>Flight Details:</p>
    <ul>
      <li>Flight A123 - Chennai to Mumbai</li>
      <li>Flight B456 - Delhi to Bangalore</li>
    </ul>
  </div>
);

export default GuestPage;
